package org.mingtaoz.leetcode.string;

import junit.framework.Test;
import junit.framework.TestCase;
import junit.framework.TestSuite;

public class DistinctSubsequencesTest extends TestCase {

	private DistinctSubsequences sut;

	public DistinctSubsequencesTest(String testName) {
		super(testName);
		sut = new DistinctSubsequences();
	}

	public static Test suite() {
		return new TestSuite(DistinctSubsequencesTest.class);
	}

	public void testNumDistinct1() {
		String S = "rabbbit";
		String T = "rabbit";
		assertEquals(3, sut.numDistinct(S, T));
	}

	public void testNumDistinct2() {
		String S = "aabdbaabeeadcbbdedacbbeecbabebaeeecaeabaedadcbdbcdaabebdadbbaeabdadeaabbabbecebbebcaddaacccebeaeedababedeacdeaaaeeaecbe";
		String T = "bddabdcae";
		assertEquals(10582116, sut.numDistinct(S, T));
	}

	public void testNumDistinct3() {
		String S = "";
		String T = "rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys";
		assertEquals(1456742400, sut.numDistinct(S, T));
	}

	public void testNumDistinct4() {
		String S = "";
		String T = "a";
		assertEquals(0, sut.numDistinct(S, T));
	}

	public void testNumDistinct5() {
		String S = "ddd";
		String T = "dd";
		assertEquals(3, sut.numDistinct(S, T));
	}
}
